import React from 'react';
import './card.css';

export const Card = props => {
  // Same as export default Card at the end of app must add {} when importing ex {Card}
  const { monster } = props;
  return (
    <div>
    <img alt="monster" />
      <h1 className="card-container">{monster}</h1>
    </div>
  );
};
